    function colorPriority(priority) {
        var p = parseInt(priority);
        var r;
        if (p == 1) {
            r = '#E74C3C';
        } else if (p == 2) {
            r = '#F1C40F'
        } else {
            r = '#4099ff'
        }

        return r;
    }



    function makeReport(device, startDate, endDate) {

        var isoStartDate = new Date(startDate).toISOString();
        var isoEndDate = new Date(endDate).toISOString();
        t.clear();
        fillTable(isoStartDate,isoEndDate, device);
      

        moment.locale('es');
        $("#selectedDevice").html(device);
        
       
    }

    function fillTable(isoStartDate,isoEndDate, device){
       
        baja.Ord.make("alarm:/|bql: select timestamp,alarmData, normalTime where timestamp >='" + isoStartDate + "' and timestamp <= '" + isoEndDate + "' and alarmClass='" + device + "'").get({
                lease: true
            })
            .then(function(alarms) {
                alarms.cursor({
                    before: function() {
                    
                    },
                    each: function() {
                       
                        t.row.add([
                           
                            moment(this.get("timestamp").getJsDate()).format('lll'),
                            //this.get("timestamp").getJsDate().toDateString()+' '+this.get("timestamp").getTime(),
                            this.get("alarmData").get("sourceName"),
                            this.get("alarmData").get("msgText")+'. '+putValue(this.get("alarmData")),
                            (this.get("normalTime").getDate().getYear()>1970)?moment(this.get("normalTime").getJsDate()).format('lll'):'Alarma no ha vuelto a su estado normal'


                        ]).draw();
                    },
                    after: function() {
                        
                            $('#data').css('display','block');
                            $('.alarmsConta').css('display','none');
                            
                            
                         
                    },
                    limit: 1000,
                })
            })
        }

    
    var findSymbolForClass = function (selector) {
        var result = '';
        var sheets = document.styleSheets;

        for (var sheetNr = 0; sheetNr < sheets.length; sheetNr++) {
            var content = findCSSRuleContent(sheets[sheetNr], selector);

            if (content) {
                result = stripQuotes(content);
                break;
            }
        }
        return result;
    };
    
    function putValue(alarmData){
       
      var mess;
      if(alarmData.get("offnormalValue")!==null){
        
        mess='Valor anterior: '+alarmData.get("offnormalValue").toString();
    }
        else{
          mess='';
        }
        return mess;
      
    }

    function findCSSRuleContent(mySheet, selector) {
        var ruleContent = '';
        var rules = mySheet.cssRules ? mySheet.cssRules : mySheet.rules;

        for (var i = 0; i < rules.length; i++) {
            var text = rules[i].selectorText;
            
           //console.log(text);
            if (text && text.indexOf(selector) >= 0) {
          
                ruleContent = rules[i].style.content;
                break;
            }
        }

        return ruleContent;
    }

    function stripQuotes(string) {
        var len = string.length;
        return string.slice(1, len - 1);
    }

